import{_ as a,e}from"./app.ab081e37.js";const r={},i=e('<h2 id="notice" tabindex="-1"><a class="header-anchor" href="#notice" aria-hidden="true">#</a> Notice</h2><p>This manual is for package with version &lt;= 1.0.</p><h2 id="wslu-help" tabindex="-1"><a class="header-anchor" href="#wslu-help" aria-hidden="true">#</a> wslu help</h2><p>print a simplified help.</p><h2 id="wslu-version" tabindex="-1"><a class="header-anchor" href="#wslu-version" aria-hidden="true">#</a> wslu version</h2><p>print current version.</p><h2 id="wslu-install" tabindex="-1"><a class="header-anchor" href="#wslu-install" aria-hidden="true">#</a> wslu install</h2><p>install is a minimal package manager for installing special packages. Also, it provide some simple commands to install apps from third-party repositories.</p><h3 id="pulseaudio" tabindex="-1"><a class="header-anchor" href="#pulseaudio" aria-hidden="true">#</a> pulseaudio</h3><p>install pulseaudio to provide additional sound playing feature to WSL.</p><h3 id="vcxsrv" tabindex="-1"><a class="header-anchor" href="#vcxsrv" aria-hidden="true">#</a> vcxsrv</h3><p>install vcxsrv to provide additional GUI feature to WSL.</p><h3 id="third-party-packages-repository" tabindex="-1"><a class="header-anchor" href="#third-party-packages-repository" aria-hidden="true">#</a> [third-party packages] [repository]</h3><p>install a application with a certain third-party repository.</p><h2 id="fetch" tabindex="-1"><a class="header-anchor" href="#fetch" aria-hidden="true">#</a> fetch</h2><p>the minimal screen fetch program inspired by <strong>ufetch</strong> and <strong>ScreenFetch</strong>.</p><h2 id="system" tabindex="-1"><a class="header-anchor" href="#system" aria-hidden="true">#</a> system</h2><p>system will help print out the system information without any parameters. more options are following:</p><h3 id="b-build" tabindex="-1"><a class="header-anchor" href="#b-build" aria-hidden="true">#</a> -B, --build</h3><p>print Windows build information, for example: <strong>Windows 10 Build 16193</strong></p><h3 id="k-kernel" tabindex="-1"><a class="header-anchor" href="#k-kernel" aria-hidden="true">#</a> -K, --kernel</h3><p>print WSL kernel info, for example: <strong>Linux 4.4.0-43-Microsoft</strong></p><h3 id="r-release" tabindex="-1"><a class="header-anchor" href="#r-release" aria-hidden="true">#</a> -R, --release</h3><p>print WSL system release info, for example: <strong>Ubuntu 16.04.2 LTS</strong></p><h3 id="p-package" tabindex="-1"><a class="header-anchor" href="#p-package" aria-hidden="true">#</a> -P, --package</h3><p>print total installed packages, for example: <strong>1511</strong></p><h2 id="shortcut-appname" tabindex="-1"><a class="header-anchor" href="#shortcut-appname" aria-hidden="true">#</a> shortcut [appname]</h2><p>shortcut command help you create a shortcut on the Windows 10 Desktop.</p>',28);function t(s,n){return i}var o=a(r,[["render",t],["__file","beta-rel-man.html.vue"]]);export{o as default};
